import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Components
import PageTitle from '../components/PageTitle';
import Items from '../components/Items';
// Material Components
import Grid from '@material-ui/core/Grid';

import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
// Utils
import { keyitems, keyitemsGen, keyitemsFilters } from '../utils/keyitems';

const styles = theme => ({
  root: {
    width: '100%',
  },
});

function KeyItems(props) {
  const { classes } = props;
  const pagetitle = 'Key Items';

  const state = {
    display: true,
  }

  return (
    <div className={classes.root}>
      <PageTitle pagetitle={pagetitle} />
      <Grid container spacing={24} justify="center">
        <Grid item xs={12} sm={6}>

        {keyitemsFilters && (
          <FormGroup row>
            {keyitemsFilters.map(filter => (
              <FormControlLabel
                control={
                  <Checkbox
                    checked={filter}
                    onChange={event => this.setState({ filter: event.target.checked })}
                    value={filter}
                  />
                }
                label={filter}
              />
            ))}
          </FormGroup>
        )}





          <Items data={keyitems} dataGeneral={keyitemsGen} dataFilters={keyitemsFilters} />
        </Grid>
      </Grid>
    </div>
  );

}

KeyItems.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(KeyItems);
